import React from 'react'
import { Link, Router } from 'react-router-dom'

function NavBar() {
  return (
    <nav>
      <Router><Link to='/'>Home</Link>
      <Link to='/Search/'>Search Products</Link></Router>

    </nav>
  )
}

export default NavBar
